import React, { Component } from "react";
import Table from 'react-bootstrap/Table';

export default class TableRowComponent extends Component { 
    render() { 
        const course = this.props.course;

        return ( 
            <tr> 
                <td className="border-danger border border-3">{course.description}</td>
                <td className="border-danger border border-3">{course.semester}</td>
                <td className="border-danger border-white border-1">{course.prefix}</td>
                <td className="border-danger border-white border-1">{course.number}</td>
                <td className="border-danger border border-3">{course.grade}</td>
            </tr>
        );
    }
}
